import React from "react";
import "./about.css";

const About = () => {
  return (
    <section className="about Section" id="about">
      <h2>About Me</h2>
      <p classN="about-para">
        I’m Shruti Gour, a Computer Science Engineering graduate (2020–2024)
        from Shri Vaishnav Institute of Information Technology, Indore, with a
        CGPA of 7.1. I’m passionate about frontend development and design,
        skilled in HTML, CSS, JavaScript, and React, and enjoy creating visually
        appealing, responsive web applications. As a fresher, I’m eager to
        learn, grow, and contribute to meaningful projects.
      </p>
    </section>
  );
};

export default About;
